import React from 'react';
import NavbarComponent from '../components/navbar';
import FooterComponent from '../components/footer';

function Layout({ children }) {
    return (
        <div>
            <NavbarComponent />
            <main>{children}</main>
            <FooterComponent />
        </div>
    );
}

export default Layout;
